import styles from './FieldSet.module.scss';
import { TextField } from '@material-ui/core';
const FieldSet = () =>{
    return(
        <div className={styles.form}>
            <TextField id='outlined-basic' variant='outlined' label='Tiêu Đề'/>
            <TextField/>
        </div>
    )
}

export default FieldSet;
